CREATE DATABASE capstone_module1;
USE capstone_module1;

CREATE TABLE data_transaksi_ecommerce (
    id_transaksi INT AUTO_INCREMENT PRIMARY KEY,
    tanggal DATE,
    nama_pelanggan VARCHAR(100),
    produk VARCHAR(100),
    kategori_produk VARCHAR(50),
    jumlah INT,
    harga_satuan FLOAT,
    total_harga FLOAT,
    diskon_persen FLOAT,
    biaya_pengiriman FLOAT,
    total_akhir FLOAT,
    metode_pembayaran VARCHAR(50),
    kota VARCHAR(100),
    rating_pelanggan FLOAT,
    status_pengiriman ENUM('Selesai', 'Dikirim', 'Dibatalkan', 'Pending'),
    channel_penjualan ENUM('Website', 'Mobile App', 'Marketplace')
);

